import React from 'react'; 
import {Button, Modal} from 'react-bootstrap';

const ModalV = (props)=>{
    const { showSucess, sucess,getUserId,modleShow,deleteConfirm} = props ;
    return(
        <div>
            { 
                getUserId ?
                    <Modal show={modleShow} onHide ={this.deleteConfirm} > 
                        <Modal.Body>Are you sure!</Modal.Body>
                        <Modal.Footer>
                        <Button variant="secondary" onClick ={()=>this.deleteConfirm(false)}  >
                            Close
                        </Button>
                        <Button variant="primary" onClick ={()=>{this.handleRemove(getUserId);this.deleteConfirm(false)}}>
                            delete
                        </Button>
                        </Modal.Footer>
                    </Modal> :''
                }
                { 
                    sucess ?
                        <Modal show={showSucess} size ="sm" onHide ={this.handleSucces}> 
                            <Modal.Body>{sucess}</Modal.Body> 
                        </Modal> :''
                }
        </div>
    )
}
export default ModalV
